import HighlightIcon from "@material-ui/icons/Highlight";

function Header (){

    return (
        <header>
          <h1>
            <HighlightIcon />
            Michael Powell
          </h1>
        </header>
      );
}

function Home() {
    return (
      <div>
        <h2>Home</h2>
      </div>
    );
  }
  
  function About() {
    return (
      <div>
        <h2>About</h2>
      </div>
    );
  }
  
  function Dashboard() {
    return (
      <div>
        <h2>Dashboard</h2>
      </div>
    );
  }

export default Header;
